B.a0b=new A.be(B.b5,["assets/images/1.png","Deployment 1","AWaDH CPS Lab launched at National Institute of Technology Delhi.","The inauguration of the AWaDH CPS Lab, graced by Dr. Ekta Kapoor, Mission Director of NM-ICPS, in the august presence of the Prof Ajay K Sharma, Director; Dr Ravinder Kumar, Registrar; Dr Anurag Singh, Dean R&C from NIT Delhi; and Dean R&D, IIT Ropar; Dr Suman Kuman, Assistant Professor & IoT Domain Coordinator; Dr Brijesh Kumbhani, Assistant Professor IIT Ropar and other team members from iHubAWaDHsignifies the commencement of a collaborative effort to establish a CPS skilling platform. This initiative is designed to empower young graduates, postgraduates, researchers, faculty, and startups to delve into the realm of Cyber-Physical Systems (CPS) and incorporate these interventions into their daily activities."],t.o)
B.a09=new A.be(B.b5,["assets/images/2.png","Deployment 2","AWaDH CPS lab at Dr. BR Ambedkar Institute Jalandhar.","AWaDH has inaugurated the AWaDH CPS Lab at the Dr B R Ambedkar National Institute of Technology Jalandhar in its Electronics and Communication Engineering Department. This lab serves as a platform for education, research, prototyping, testing, and collaboration. The event included an inauguration ceremony, a keynote address by Professor Binod Kumar Kanaujia, Director, Dr B R Ambedkar National Institute of Technology Jalandhar along with Team from IIT Ropar Dr Suman Kumar, Associate Professor, IIT Ropar; Dr Radhika Trikha, COO, IIT Ropar TIF AWaDH; Mr Mukesh Kestwal, CIO, IIT Ropar TIF AWaDH along with the technical team from AWaDH on the Occasion, and a tour of the lab. "],t.o)
B.a0j=new A.be(B.b5,["assets/images/3.png","Deployment 3","AWaDH CPS Lab launched at Tula\u2019s Institute Dehradun.","The inauguration of the AWaDH CPS Lab, graced by IIT Ropar representatives and leadership team from Tula\u2019s institute Ms Silky Jain Marwah, Executive Director, Tula\u2019s Institute; Raunak Jain, Vice President, Tula\u2019s Group; Dr Raghav Garg, Vice President Technology Tula\u2019s Institute and Dr Sandip Vijay, Director, Tula\u2019s Institute and PI of the initiative Dr Sunil Semwal, Dean R&D, Tula\u2019s Institute and Co PI Dr Nishant Saxena, Dean Academics, Tula\u2019s Institute signifies the commencement of a collaborative effort to establish a CPS skilling platform. This initiative is designed to empower young graduates, postgraduates, researchers, faculty, and startups to delve into the realm of Cyber-Physical Systems (CPS) and incorporate these interventions into their daily activities. The lab features cutting-edge IoT kits developed by IIT Ropar, providing a 24X7 plug-and-play module for hands-on experimentation and exploration of the IoT landscape"],t.o)
B.a08=new A.be(B.b5,["assets/images/4.png","Deployment 4","AWaDH CPS Lab launched at Thapar Institute of Engineering and Technology, Patiala.","The AWaDH CPS Lab at TIET is part of the larger network of CPS labs under the National Mission on Interdisciplinary Cyber-Physical Systems (NM ICPS), Government of India. These labs are dedicated to promoting research, development, and deployment of CPS technologies, providing students, entrepreneurs, and researchers with the hands-on experience and expertise needed in this transformative field."],t.o)
B.a0k=new A.be(B.b5,["assets/images/5.png","Deployment 5","AWaDH CPS Lab launched at Chitkara University, Punjab.","The Skilling for Emerging Technologies under the National Mission on Interdisciplinary Cyber-Physical Systems (NM ICPS), Department of Science and Technology, the Indian Institute of Technology (IIT) Ropar, through its Technology and Innovation Foundation (iHub-AWaDH), inaugurated the AWaDH CPS Lab, the state-of-the-art facility to provide an integrated platform for Cyber Physical Systems education, skilling, research and collaboration at Chitkara University."],t.o)
B.a0d=new A.be(B.b5,["assets/images/8.png","Deployment 6","AWaDH CPS Lab launched at Baba Farid College of Engineering & Technology, Bhatinda ","In a significant step towards advancing technical education and innovation, the National Mission on Interdisciplinary Cyber-Physical Systems (NM ICPS) has launched a series of skilling initiatives focused on emerging technologies. This initiative, spearheaded by the Department of Science and Technology, Government of India, aims to equip students, researchers, and professionals with the expertise required to excel in the rapidly evolving field of Cyber-Physical Systems (CPS). By establishing state-of-the-art labs and providing cutting-edge resources, it is committed to fostering a robust ecosystem of technological advancement and skill development."],t.o)
B.a0h=new A.be(B.b5,["assets/images/6.png","Deployment 7","AWaDH CPS Lab launched at University of Ladakh, Leh Campus, Taru.","The seventh Cyber-Physical Systems (CPS) Lab has been established at the University of Ladakh through the initiative of IIT Ropar\u2019s AWaDH, marking a significant step in advancing technology education across India, including the country\u2019s most remote and challenging regions. This milestone reflects the impact of collaboration and the potential of emerging technologies to drive meaningful change."],t.o)
B.a0n=new A.be(B.b5,["assets/images/9.png","Deployment 8","AWaDH CPS Lab launched at Centre for Computers and Communication Technology, Chisopani, Sikkim.","iHub \u2013 AWaDH @ IIT Ropar has taken a bold step forward by launching its 8th Cyber-Physical Systems (CPS) Lab at the Centre for Computers and Communication Technology (CCCT) in Chisopani, Sikkim. This initiative isn\u2019t just about technology; it\u2019s about breaking barriers. In a region where slow or non-existent internet can delay even the simplest digital task, the CPS Lab aims to create a bridge between innovation and accessibility."],t.o)
B.a0o=new A.be(B.b5,["assets/images/10.png","Deployment 9","AWaDH CPS Lab launched at Khalsa College of Engineering and Technology (KCET), Amritsar.","In the heart of the holy city of Amritsar, renowned for its heritage and spirituality, a new chapter in technological education began with the inauguration of the 9th Cyber-Physical Systems (CPS) Lab by iHub \u2013 AWaDH @ IIT Ropar. Hosted at the prestigious Khalsa College of Engineering and Technology (KCET), a NAAC Grade A institution, this event marked a significant leap forward in innovation and education, setting the stage for a brighter, tech-driven future."],t.o)
B.a0a=new A.be(B.b5,["assets/images/11.png","Deployment 10","AWaDH CPS Lab launched at Indian Institute of Information Technology (IIIT), Una.","Nestled in the serene hills of Himachal Pradesh, innovation took a bold step forward with the launch of the 10th Cyber-Physical Systems (CPS) Lab by iHub \u2013 AWaDH @ IIT Ropar at the Indian Institute of Information Technology (IIIT), Una. This achievement isn\u2019t just about state-of-the-art facilities\u2014it\u2019s about creating a thriving ecosystem of collaboration, creativity, and transformative technologies."],t.o)
B.a0i=new A.be(B.b5,["assets/images/12.png","Deployment 11","AWaDH CPS Lab launched at Chamber of Industrial & Commercial Undertakings (CICU), Ludhiana.","In the heart of Punjab\u2019s industrial hub, a new chapter in technology and innovation unfolded as iHub \u2013 AWaDH @ IIT Ropar inaugurated its 11th Cyber-Physical Systems (CPS) Lab at the Chamber of Industrial & Commercial Undertakings (CICU), Ludhiana. This milestone marks not just another lab opening but a significant step in strengthening the bridge between academia and industry."],t.o)
B.a0e=new A.be(B.b5,["assets/images/14.png","Deployment 12","AWaDH CPS Lab launched at IILM University, Greater Noida.","IIT Ropar TIF AWaDH is thrilled to announce the inauguration of its 12th Cyber-Physical Systems (CPS) Lab, marking a significant milestone as the first CPS Lab in Uttar Pradesh. Located at IILM University, Greater Noida, this cutting-edge facility is designed to serve as a central hub for Artificial Intelligence (AI), Internet of Things (IoT), and CPS technologies. The lab will provide students and researchers with hands-on training and practical experience, fostering advancements in deep-tech applications and research."],t.o)
B.a0f=new A.be(B.b5,["assets/images/7.png","Deployment 13","AWaDH CPS Lab launched at HRIT University, Ghaziabad.","The Indian Institute of Technology (IIT) Ropar continues its commitment to advancing India\u2019s Cyber-Physical Systems (CPS) ecosystem with the launch of its 13th CPS Lab, powered by the National Mission on Interdisciplinary Cyber-Physical Systems (NM-ICPS). This new lab, located at HRIT University in Ghaziabad, marks another significant step in democratizing access to next-generation technologies and equipping students with the skills needed for real-time, tech-driven innovation."],t.o)
B.a0m=new A.be(B.b5,["assets/images/13.png","Deployment 14","AWaDH CPS Lab launched at Sardar Vallabhbhai Patel University of Agriculture and Technology, Meerut.","The launch of the Agri-Tech Innovation Hub at Sardar Vallabhbhai Patel University of Agriculture and Technology (SVPUAT), Meerut, in collaboration with IIT Ropar, marked a significant milestone in India\u2019s agricultural transformation. This event brought together policymakers, academic leaders, scientists, innovators, and startups, all united by a shared vision: to revolutionize Indian agriculture through technology, research, and entrepreneurship."],t.o)
B.a0c=new A.be(B.b5,["assets/images/15.png","Deployment 15","AWaDH CPS Lab launched at Acropolis Institute of Technology and Research, Indore.","On 26 August 2025, the Indian Institute of Technology, Ropar, through its iHub \u2013 AWaDH initiative, inaugurated its 15th Cyber-Physical Systems (CPS) Lab under the National Mission on Interdisciplinary Cyber-Physical Systems (NM-ICPS) at the Acropolis Institute of Technology and Research, Indore. Marking the first CPS lab in Madhya Pradesh, this facility represents a significant step in decentralizing advanced technological research and innovation across India."],t.o)
B.a0l=new A.be(B.b5,["assets/images/17.png","Deployment 16","AWaDH CPS Lab launched at Hindustan Institute of Technology and Science, Chennai.","On 20 September 2025, the Indian Institute of Technology (IIT) Ropar \u2013 iHub AWaDH inaugurated its 16th Cyber-Physical Systems (CPS) Laboratory at the Hindustan Institute of Technology and Science (HITS), Chennai, Tamil Nadu, under the National Mission on Interdisciplinary Cyber-Physical Systems (NM-ICPS), Department of Science & Technology (DST). This landmark event marks the establishment of the first-ever CPS Lab in South India, expanding the national CPS Lab network and strengthening India\u2019s mission to decentralize deep-tech innovation. A Milestone for Tamil Nadu and South India."],t.o)
B.a0g=new A.be(B.b5,["assets/images/16.png","Deployment 17","AWaDH CPS Lab launched at Model Institute of Engineering and Technology, Jammu.","Innovation has reached the Himalayas. On 25 September 2025, the Indian Institute of Technology (IIT) Ropar \u2013 Technology and Innovation Foundation, iHub AWaDH, inaugurated its 17th Cyber-Physical Systems (CPS) Laboratory at the Model Institute of Engineering and Technology (MIET), Jammu. This marks a historic milestone \u2014 the first-ever CPS Lab in Jammu & Kashmir under the Government of India\u2019s National Mission on Interdisciplinary Cyber-Physical Systems (NM-ICPS), Department of Science & Technology (DST). A Landmark for Deep-Tech in J&K The establishment of this CPS Lab extends the nationwide CPS Lab network to the Union Territory of Jammu & Kashmir, bringing deep-tech research, skilling, and innovation infrastructure closer to students, researchers, and entrepreneurs in the region."],t.o)
